function Wilaya() {
  
  useEffect(() => {
    
      
        async () => await fetch('http://127.0.0.1:8000/user', {
          headers: {
            'Content-Type': 'application/json',
          },
        });

  });

  return (
    <div className="p-4 bg-gray-100">
      <h1>hello</h1>
    </div>
  );
}

export default Wilaya;
